import Home from '../pages/Home';
import About from '../pages/About';
import News from '../pages/News';
import { Navigate } from 'react-router-dom';

export default [
  {
    path: "/home",
    element: <Home />,
    children: [
      {
        path: "news",
        element: <News />,
        children: [
          {
            path: "detail",
            element: <Detail />,
          }
        ]
      }
    ]
  },
  {
    path: "/about",
    element: <About />
  },
  {
    path: "/",
    element: <Navigate to="/home" />
  },
]
